    function checkZKP(
        uint[2] memory a,
        uint[2][2] memory b,
        uint[2] memory c,
        uint[183] memory input
    ) public returns (bool) {
        Verifier.Proof memory proof = Verifier.Proof(
            Pairing.G1Point(a[0], a[1]),
            Pairing.G2Point(b[0], b[1]),
            Pairing.G1Point(c[0], c[1])
        );
        return verifier.verifyTx(proof, input);
    }

